		var jmpressOpts = {
    animation       : { transitionDuration : '0.8s' }
};
			$(function() {
			
				$( '#jms-slideshow' ).jmslideshow($.extend( true, { jmpressOpts : jmpressOpts }, {
					    autoplay    : true,
					     interval    : 4500

			function updateGraph(dt, chart){
	var w = 20;
	var colors = d3.scale.category10();
	
	var group = chart.selectAll("g")
		.data(dt)
		.enter().append("g");

	var bar = group.selectAll("rect")
		.data(function(d){
			return d;
		});

	// update
	bar.attr("transform", function(d, i) {
			x = "translate("+(i*2.2*w+j*w)+",0)";
			return x; })
		.transition()
		.duration(130)
		.attr("width", w)
		.attr("height", function(d){return d*10;});
	
	// enter
	bar.enter().append("rect")
		.attr("transform", function(d, i, j) {
			transl = "translate("+(i*2.2*w+j*w)+",0)";
			return transl; })
		.attr("fill", function(d,i,j){
			return colors(j);})
		.attr("height", 0)
		.attr("width", w)
		.transition()
		.duration(7350)
		.attr("height", function(d){return d*10;});

	// exit
	bar.exit()
		.transition()
		.duration(750)
		.attr("height", 0)
		.remove();
}


chart = d3.select("#jms-slideshow").append("svg")
	.attr("class", "graph")
	.attr("width", 800)
	.attr("height", 200);

// prepare data
l = [[1,2,3,4,5,6], [6,5,4,3,2,1]];

// intialize graph
updateGraph(l, chart);

// update graph regularly
// generate a nested dataset with random numbers
setInterval(function(){
	l = [];
	len = Math.round(Math.random()*20);
	for (j= 0; j<2; j++){
		lt = [];
		for (i = 0; i<len; i++){
			lt.push(Math.round(Math.random()*20));
		}
		l.push(lt);
	}
	updateGraph(l, chart);
}, 1500);
		</script>

		<script>
		window.App = angular.module('App', []);

App.controller('GpaController', function($scope){
  var points = [
    {x: 30, y: 50},
    {x: 100, y: 80},
    {x: 200, y: 40},
    {x: 280, y: 30}
  ];
  
  $scope.points = points;
  
  $scope.linePath = function(){
    var pathParts = [], currentPoint, i;
    
    for (i = 0; i < points.length; i++) {
      currentPoint = points[i];
      pathParts.push(currentPoint.x + "," + currentPoint.y);
    }

    return "M" + pathParts.join(" L");
  };
});
		</script>
